import React, { Component } from "react";
import '../styles/app.css';
// import {Preloader} from './Preloader'
import FetchData from "./FetchData";
import 'bootstrap/dist/css/bootstrap.min.css';



class App extends Component {
  state = {
    url: null,
    // isLoading: false
  }

  setUrlMin() {
    this.setState({
      url: 'data-min'
    });
    // this.setState({
    //   isLoading: true
    // });
    // setTimeout(() => this.setState({ isLoading: false }), 300);
  }

  setUrlMax() {
    this.setState({
      url: 'data'
    });
    // this.setState({
    //   isLoading: true
    // });
    // setTimeout(() => this.setState({ isLoading: false }), 5000);
  }

  // componentDidMount() {
  //   setTimeout(() => this.setState({ isLoading: false }), 2000);
  // }

  render() {
    // const { isLoading } = this.state;

    return (
      <div className="App">
      {/* <DataChange /> */}
      <div className="data-buttons">
        <button className="btn btn-outline-primary btn-lg" onClick={this.setUrlMin.bind(this)}>
          Get min
        </button>
        <button className="btn btn-outline-primary btn-lg" onClick={this.setUrlMax.bind(this)}>
          Get max
        </button>
      </div>
        {this.state.url !== null && <FetchData urlType = {this.state.url}/>}           
      </div>
    );
  }
}

export default App;
